ઉપલબ્ધ કમાન્ડ્સ:
  @show              ─ છેલ્લો adaptive card સારાંશ દર્શાવો
  @json              ─ flowમાંથી મળેલ કાચો JSON મૂલ્ય બહાર પાડો
  @back              ─ અગાઉના અવરોધિત card/inputs પર પાછા ફરો
  @input <k>=<v>     ─ input field સેટ કરો અથવા ઓવરરાઈડ કરો
  @click <action_id> ─ આપેલ action સાથે card submit કરો
  @help              ─ આ સહાય લખાણ પ્રિન્ટ કરો
  @quit              ─ REPL માંથી બહાર નીકળો
